import React from "react";
import styled from "styled-components";

const Skill =(props)=>{
    return(
        <Wrapper>
            <IconContainer>
                <i className="fab fa-react fa-2x"/>
            </IconContainer>
            {props.title}
        </Wrapper>
    )
}

export {Skill};

const Wrapper = styled.div`
width:100%;
`;

const IconContainer = styled.div`
border-bottom: 1.5px solid black;
`;
